import React from 'react'
import { useState,useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import '../ExamMaster/QuestionForTopicView.css';


const QuestionForTopicView = () => {
  const params=useParams();
  const topicId = params.topicId;
  const examId=params.examId;
  console.log("ExamId...>",examId);
  console.log("param exam id...>",topicId);
    const [questionData, setQuestionData] = useState([]);
    const [topicName, setTopicName] = useState("");
  
    const navigate=useNavigate();

    var topicid;



  async function QuestionDetails()  {
        console.log("question Details is called....");
        console.log(topicId);
        const map = {
          topicId: topicId,
        };
    
        const response = await fetch(
          "https://localhost:8443/onlineexam/control/viewQuestions",
          {
            method: "POST",
            credentials: "include",
            body: JSON.stringify(map),
            headers: {
              "Content-type": "application/json",
            },
          }
        );
    
        const result = await response.json();
        console.log(result);
        const myobj = result.resultMap.listQuestions;
        const topicname = result.resultMap.topicName;
        let resultvalue = {
          myobj: myobj,
          topicname: topicname,
        };
        console.log("result", result.resultMap.listQuestions);
        console.log("second result,", result.resultMap.topicName);
        setQuestionData([...result.resultMap.listQuestions]);
        // setQuestionData([ ...resultvalue]);
        console.log("result value......", resultvalue);
        console.log("question data....", questionData);
        setTopicName(result.resultMap.topicName);
        topicid=result.resultMap.listQuestions.topicId;
        console.log("My topic Id...>",topicid);
        console.log("Topic Name",result.resultMap.topicName);
        console.log("My result....", result);
      
      };
      useEffect(() => {
        QuestionDetails();
      }, []);

  return (
    <div>
         <div className="container my-5">
        <table className="table table-striped w-75">
          <thead>
            <tr>
              <th>TopicName : {topicName}</th>
    
              <th><button className="btn btn-primary btn-2">Add Question</button></th>

            </tr>
          </thead>
          <tbody>
            {questionData ? (
              questionData.map((obj, value) => {
            
                return (
                  <div className='d-flex w-100 r-div'>
                    <div className='h6'>Question: {obj.questionDetail}</div>
                    <div className='i-div d-flex offset-9'>
                    <button className="btn btn-primary btn1" onClick={()=>navigate(`/admin/updateExam/examdetails/question-topicView/view-questions/${obj.questionId}`)}>View Details</button>
                    <button className="btn btn-danger">Delete</button>
                    </div>
                  </div>
                );
              })
            ) : (
              <>No data</>
            )}
          </tbody>

        </table>
      </div>
        <div><button className="btn btn-primary" onClick={()=>navigate(`/admin/updateExam/examdetails/${examId}`)}>Back</button></div>
    </div>
  )
}

export default QuestionForTopicView
